    return ( 
        <div>
            <Header />
            <div className={styles.chat}>
                <div>
                    <div className={styles.message__container}>
                        <div class="image">
                            <img src="/img/sohee.jpg" alt="Image" />
                        </div>
                        <div className={styles.message}>
                            <p>채팅 내용</p>
                        </div>
                    </div>
                </div>
                <div>
                    <input className={styles.input}></input>
                </div>
            </div> 
        </div>
    );
}

export default Recommend;
